#include <string>
#include <vector>
#include <iostream>
#include <algorithm>

using namespace std;
int ans=0;

void bin_sch(int st, int en, int k, string road) {
    cout<<st<<" "<<en<<" "<<'\n';
    if(st>en) return;
    int mid=(st+en)/2;
    int fl=0;

    string tmp = road.substr(0, mid);
    int n=count(tmp.begin(), tmp.end(),'0');
    if(n<=k) fl=1;
    if(fl==0) {
        for(int i=1;i<=road.size()-mid;i++) {
//            string tmp1 = road.substr(i, mid);
            if(road[i-1]=='0') n=n-1;
            if(road[i+mid-1]=='0') n=n+1;
            if(n<=k) {
                fl=1;
                break;
            }
        }
    }

    if(fl==1) {
        if(mid>ans) ans=mid;
        if(st==en) return;
        bin_sch(mid+1, en, k, road);
    } else {
        if(st==en) return;
        bin_sch(st, mid, k, road);
    }
}
int solution(string road, int n) {
    int answer = -1;
//    cout<<road.size()<<'\n';
    bin_sch(0, road.size(), n, road);
    answer=ans;
    return answer;
}

int main()
{
    ios::sync_with_stdio(false);
    cout.tie(NULL);
    cout << solution("", 11) << '\n';
    return 0;
}
